package problem76

import "testing"

func TestMinWindow(t *testing.T) {
	testCases := []struct {
		s, t string
		want string
	}{
		{
			s:    "ADOBECODEBANC",
			t:    "ABC",
			want: "BANC",
		},
		{
			s:    "a",
			t:    "a",
			want: "a",
		},
		{
			s:    "a",
			t:    "aa",
			want: "",
		},
		{
			s:    "a",
			t:    "b",
			want: "",
		},
		{
			s:    "",
			t:    "",
			want: "",
		},
	}

	for _, tC := range testCases {
		if got := minWindow(tC.s, tC.t); got != tC.want {
			t.Errorf("Test failed. The input s = \"%s\", t = \"%s\" is expected to \"%s\" but return \"%s\"", tC.s, tC.t, tC.want, got)
		}
	}
}
